import { Component } from "./devComponent";
import {useStore,useEffectV2,Guest,Game,Force_Logout,Get_All_Setting,Start_With_Token, useSelector} from "./importAll"

const App =()=>{
    let store = useStore();

    useEffectV2("app",()=>{
        Start_With_Token(store);
        Force_Logout(store);
        Get_All_Setting(store)
    })

    return(
        <>
          
            <Comp value="sdasd" />

           {/* <Guest/>
           <Game/>  */}
        </>
    )
}
export default App





const Comp = Component({middle},(props:any)=>{

    let main = useSelector<IStore,any>(store=>store.mainPage)
    return <>asdasd:  {props.value} and {main.toString()}</>
})


function middle(){
    // let isLogin = useSelector<IStore,any>(store=>store.isLogin)

    return true
}
